Enter to win this one of a kind, hand embellished print and save endangered species at the same time!  Hawaiian Honeycreeper Day is on 8/08 and to celebrate I’m giving away this unique print with a hand painted Kiwikiu. To enter:

🔵Donate a minimum of $10 to one of the following organizations (links in my bio). If there’s a note section, please write in “Jon Ching Art Raffle.”

@birdsnotmosquitoes
@friends_of_hakalau 
@mauiforestbirds 
@kauaiforestbirds 

🔵Every $5 gets you one entry, so $10 gets 2, $15 gets 3, until $20 (4 entries). After $20, every $5 is doubled, so $25 gets you 6 entires, $30 gets 8, $35 gets 10, etc…

🔵Email me me your donation confirmation by 10 PM PT on 8/07 - jon@jonchingart.com

🔵On 8/08 at 1PM PT I will randomly choose a winner and notify them by email. The winner will have 24 hours to respond.

🔵Once confirmed, I’ll let everyone know and send out the print. 

Hopefully it’s easy enough for you all to take action. Thank you for your support of Hawaii’s birds. Good luck and please share this with your friends and family!

